import React, { useState } from 'react';
import API from '../utils/api';

export default function RequirementForm({contact,onDone}){
  const [log, setLog] = useState({ contacted_by:'', response:'no', follow_up_date:'', notes:'' });
  const [req, setReq] = useState({ role:'', experience:'', skills:'', openings:1, description:'' });
  const [msg, setMsg] = useState(null);

  const submitLog = async e =>{
    e.preventDefault();
    try{
      await API.post(`/contacts/${contact.id}/log`, log);
      setMsg('Logged contact');
    }catch(err){ setMsg('Error logging'); }
  }

  const submitReq = async e =>{
    e.preventDefault();
    try{
      await API.post('/requirements', { contact_id: contact.id, ...req });
      setMsg('Requirement saved');
      onDone();
    }catch(err){ setMsg('Error saving requirement'); }
  }

  return (
    <div style={{marginTop:12, padding:8, border:'1px solid #eee', borderRadius:6}}>
      <h3>Contact / Requirement for {contact.name}</h3>
      {msg && <div>{msg}</div>}

      <form onSubmit={submitLog}>
        <div style={{display:'flex', gap:8}}>
          <input placeholder="Contacted by" value={log.contacted_by} onChange={e=>setLog({...log,contacted_by:e.target.value})} />
          <select value={log.response} onChange={e=>setLog({...log,response:e.target.value})}>
            <option value="yes">Has Job Requirement</option>
            <option value="no">No Job Requirement</option>
            <option value="pending">Pending</option>
          </select>
        </div>
        <input type="date" value={log.follow_up_date} onChange={e=>setLog({...log,follow_up_date:e.target.value})} />
        <textarea placeholder="Notes" value={log.notes} onChange={e=>setLog({...log,notes:e.target.value})} />
        <button style={{marginTop:6}}>Save Contact Log</button>
      </form>

      {log.response === 'yes' && (
        <form onSubmit={submitReq} style={{marginTop:8}}>
          <h4>Add Job Requirement</h4>
          <input placeholder="Role" value={req.role} onChange={e=>setReq({...req,role:e.target.value})} required />
          <input placeholder="Experience" value={req.experience} onChange={e=>setReq({...req,experience:e.target.value})} />
          <input placeholder="Skills (comma separated)" value={req.skills} onChange={e=>setReq({...req,skills:e.target.value})} />
          <input type="number" min={1} value={req.openings} onChange={e=>setReq({...req,openings:parseInt(e.target.value||1)})} />
          <textarea placeholder="Description" value={req.description} onChange={e=>setReq({...req,description:e.target.value})} />
          <div style={{display:'flex', gap:8, marginTop:6}}>
            <button>Save Requirement</button>
            <a href="http://localhost:4000/api/requirements/export" target="_blank" rel="noreferrer">Export Excel</a>
          </div>
        </form>
      )}
    </div>
  );
}
